const fs = require("fs");
const config = require("../config.json")

const main = async function() {
  let url = `https://api.beatleader.xyz/player/${config.playerId}/scores/compact?sortBy=acc&order=asc&page=1&count=${config.lowAccCount}&type=ranked`;

  try {
    const resp = await fetch(url);
    if (!resp.ok) {
      return false
    }

    const json = await resp.json();

    let playlist = {
      playlistTitle: `BadAcc BL (${config.lowAccCount})`,
      playlistAuthor: "PixlPainter",
      image: "data:image/png;base64,",
      songs: []
    }

    for (let entry of json.data) {
      let diffName = "";
      const difficulty = entry["leaderboard"]["difficulty"];
      if (difficulty === 9) {
        diffName = "expertPlus";
      } else if (difficulty === 7) {
        diffName = "expert";
      } else if (difficulty === 5) {
        diffName = "hard";
      } else if (difficulty === 3) {
        diffName = "normal";
      } else if (difficulty === 1) {
        diffName = "easy";
      }
      const map = {
        hash: entry["leaderboard"]["songHash"],
        difficulties: [
          {
            name: diffName,
            characteristic: entry["leaderboard"]["modeName"]
          }
        ]
      }
      playlist.songs.push(map);
    }

    fs.writeFileSync("./badacc.json", JSON.stringify(playlist, null, 2));
  } catch (e) {
      console.log(e);
      return false
  }
  return true
}
main().then(r => r === true ? console.log("Fetching Low Acc Plays was successful!") : console.log("Fetching Low Acc Plays failed!"));
